import { Button} from 'react-bootstrap';

/* onClick={()=> props.state.url = ('https://www.youtube.com/watch?v='+{this.props.videoId})} */
const VideoThumbnail = (props) => (
    <button>
        <img width="210" height="118" src={props.thumbnail}></img>
        {props.title} {props.videoId}
    </button>
);
export default VideoThumbnail;
